INSERT INTO `rs_tbl_news` (`news_cd`, `title`, `details`, `newsdate`, `ordering`, `newsfile`, `newsfile1`, `newsfile2`, `newsfile3`, `newsfile4`, `status`) VALUES
(1, 'CDA Chairman Abdus Salam visiting Chittagong City Outer Ring Road on Saturday', 'CDA Chairman Abdus Salam visiting Chittagong City Outer Ring Road on Saturday. Project Director Kazi Hasan Bin Sams, Rajiv Das, Nurul Kabir, Project Manager Rabiul Hoque and Project Coordinator Nasir Hossain Didar were also present during the visit.\n\nChittagong City is the second largest city in Bangladesh and possesses export processing zones (EPZs), international airport and the largest domestic port facility; and it is expected to play an important role in the country\'s future development. However, the arterial road connecting the city centre with the port, airport, and EPZ was not well developed, which has resulted in chronic traffic congestion. Thus, it is required to improve the transportation network through the construction of a ring road.\n\nThe purpose of the project is to construct a part of the city\'s outer ring road with revetment functions in Chittagong\'s coastal region where the EPZ is located (total length 14.7km), and then to alleviate the traffic congestion of existing roads, and to mitigate damages caused by the natural disasters, such as cyclones and high flood tides etc., thereby contributing to the promotion of the city and country\'s economic development.', '2016-03-06', 1, '11.jpg', '12.jpg', '13.jpg', '14.jpg', '', 'Y'),
(2, 'Construction of Ctg Outer Ring Road progressing fast', 'CHITTAGONG, Dec 23: The construction work of the much-awaited Coastal Road and Embankment Strengthening Project, also known as Chittagong Outer Ring Road Project, at a cost of Taka 14.96 billion are progressing fast.\n\nThe Chittagong Development Authority (CDA) is implementing the project.\nThe project has been approved by the CCGP (Cabinet Committee of Government Purchase) on March 4 last.\n\nTalking to The Daily Observer, CDA Chairman Abdus Salam said the project work is going on in full swing.\n\nHe said that the Spectra EL-KNR JV has been working to complete the project within the stipulated time of next three years.\n\nUnder the project, a 15.2-Kilometre Road will be constructed on the existing coastal embankment stretching from Patenga to Sagorika Industrial Area in the city.\nThe road would strengthen the coastal embankment and raise its height from existing 23-24 feet to 33-34 feet.\n\nThe Executive Committee on National Economic Council (ECNEC) approved the Taka 8.56-billion project on March 29, 2011. But implementation of the project came to a halt in 2012-13 fiscal year since the CDA could not go for land acquisition and re-settlement at the cost of estimated Taka 5.76 billion which was allocated by the government, due to increase in land price.\n\nAs such, CDA submitted a revised budget where land acquisition and re-settlement cost was projected at Taka 5.76 billion by getting one of the three feeder roads from the project dropped. Of the total, Taka 640 million was allocated for constructing 12 bridges of the project.\n\nAs per the revised budget, the CDA will also construct four lanes on the embankment ring road around the port city. The implementation process gained pace when the government decided to provide Taka 4.5 billion at a time for land acquisition and re-settlement in May, 2013 with the ECNEC also approved revised budget of Taka 14.96 billion for the project in August, 2013.\nJapan International Cooperation Agency (JICA) will provide Taka 7.50 billion and the government will bear Taka 7.46 billion of the budget.', '2015-12-25', 1, '21.jpg', '22.jpg', '23.jpg', '24.jpg', '', 'Y'),
(3, 'Contract Signing Ceremony', 'DHAKA, March 19, 2015 (BSS) - The Construction of Chittagong City Outer Ring Road Project, involving taka 640 crore, would be completed by 2017, which is expected to ease traffic congestion in the port city. \r\n\r\nAn agreement to this effect was signed here today between Spectra Engineers Limited (SEL), leading construction house of the country in Joint Venture with KNR Limited of India, with Chittagong Development Authority (CDA) here today.\r\n\r\nThe aim of this project, funded by Japan International Cooperation Agency (JICA), is to protect Chittagong City, Sea-Prot, Airport and EPZs from flood and tidal bore. On this barrage, housing project, tourism project and various industries are expected to be setup under foreign investment.\r\n\r\nBesides bypasses will be constructed to connect highways with upcoming tunnel project on the bank of Karnaphuli river which will make huge contribution to economic development in and around port city.\r\n\r\nThe Signing Ceremony was witnessed by Minister of Housing and Public Works Engr. Mosharraf Hossain, who expressed satisfaction at launching of the project. Abdus Salam, Chairman CDA and Engr. Khalid H. Khan, on behalf of SEL-KNR JV signed the contract on behalf of their respective sides.\r\n\r\nJV Partner KNR Limited is a leading construction house of India. Whereas, Spectra Engineers Limited (SEL) is one of the most renowned construction company of Bangladesh specialized in national highways construction, bridges, buildings and other monumental jobs.\r\n\r\nSEL projects includes 4-Laning Chittagong Highway, Bay View Radission Hotel-Chittagong, Bangabandhu Military Academy Building Complex (BMA), DGFI Building-Dhaka Cantonment, 500 Bed Mymensingh Medical College Hospital and many other nationally important projects, contributing to national development of Bangladesh.', '2015-03-19', 1, '21.jpg', '22.jpg', '23.jpg', '24.jpg', '', 'N'),
(6, 'Contract Signing between APDCL &  SMEC', 'The contract was signed between APDCL & SMEC International Pty.Ltd.,Australia in Joint Venture with SMEC India Pvt.Ltd for the project Assam Distribution System Enhancement and Loss Reductio Project as Consulting Services for Project Management and Implementation Support.The duration of the project was 60 months.', '2021-08-20', 1, 'cab82-1.jpg', 'aebdc-1.jpg', 'cab82-1.jpg', 'cab82-1.jpg', 'cab82-1.jpg', 'Y'),
(7, 'Contract signing between APDCL & M/S Power Instrumentation (Guj) Ltd JV with Shalaka Infratech(I) Pvt Ltd and M/S B&B Associates', 'The contract has been signed between APDCL & M/S Power Instrumentation (Guj) Ltd joint venture with Shalaka Infratech(I) Pvt Ltd and M/S B&B Associates for execution of the Construction of new 33/11kV substation with construction of new 33kV Terminal Bay construction of 33kV & 11kV lines for Distribution System Enhancement and Loss Reduction in Tezpur Electrical Circle \'A\' on turnkey basis in LOT I:Tezpur Electrical Circle \'A\'  Part-I, NIT No:APDCL/DSELR/TEC A/01 for the contract price in aggregate of INR 15,09,31,450.00', '2021-02-12', 1, 'aebdc-1.jpg', '', '', '', '', 'Y'),
(8, 'Contract signing between APDCL &  M/S Ashoka Buildcon Limited', 'The contract has been signed between APDCL & Ashoka Buildcon Ltd. for execution of the Construction of new 33/11kV substation with construction of new 33kV Terminal Bay construction of 33kV & 11kV lines for Distribution System Enhancement and Loss Reduction in Mangaldoi Electrical Circle on turnkey basis in LOT I: Mangaldoi Part -I in Mangaldoi Electrical Circle on turnkey basis and NIT no:APDCL/DSELR/MGD/02 for the contract price in aggregate of INR 48,50,94,194.00', '2021-07-12', 1, 'aebdc-1.jpg', '', '', '', '', 'Y'),
(9, 'Contract signing between APDCL  & M/S Laser Power &Infra Pvt ltd', 'The contract has been signed between APDCL & M/S Laser Power Infra Pvt.ltd. for  execution of the Construction of new 33/11kV substation with construction of new 33kV Terminal Bay construction of 33kV & 11kV lines for Distribution System Enhancement &Loss Reduction in -\r\ni) Bongaigaon Electrical Circle on turnkey basis under NIT No:APDCL/DSELR/BNG/02.\r\n\r\nii) Barpeta-Rangia Electrical Circle on turnkey basis in LOT I:Barpeta,on turnkey basis under NIT No:APDCL/DSELR/RNG/02\r\n\r\niii) Barpeta -Rangia Electrical Circle on turnkey basis in LOT\r\nII : Rangia Part-I,on turnkey basis under NIT No:APDCL/DSELR/RNG/02\r\n\r\niv)  Barpeta -Rangia Electrical Circle on turnkey basis in LOT\r\nIII : Rangia Part-II,on turnkey basis under NIT No:APDCL/DSELR/RNG/02\r\n\r\nv) North Lakhimpur Electrical Circle on turnkey basis in LOT I:Lakhimpur Part-I,under NIT No:APDCL/DSELR/NLP/02\r\n\r\nvi) North Lakhimpur Electrical Circle on turnkey basis in LOT II:Lakhimpur Part-II,under NIT No:APDCL/DSELR/NLP/02\r\n\r\nvii) Nagaon Electrical Circle \'A\' on turnkey basis in LOT I: Nagaon Electrical Circle \'A\' Part-I,under NIT No: APDCL/DSELR/NGNA/01\r\n\r\nviii) Morigaon Electrical Circle and Nagaon Electrical Circle \'B\' Part II,under NIT No:APDCL/DSELR/NGN B/01', '2021-12-16', 1, 'aebdc-1.jpg', '', '', '', '', 'Y');
