INSERT INTO `t012issues` (`nos_id`, `pid`, `iss_no`, `iss_title`, `iss_detail`, `iss_status`, `iss_action`, `iss_remarks`, `attachment`, `iss_date`, `lid`, `action_status`, `image1`, `image2`) VALUES
(1, 1, '01', 'Land Acquisition and Resettlement Issues', 'Owners are on hold due to litigation by 2 landowners and subsequent high court injunction in this regard. - So far there are 6(six) live Writ Petitions before the Honourable High Court of\r\nBangladesh Division of Supreme Court of Bangladesh. Of those six cases three are concerning Feeder Road-2 at their preliminary stage. Further, there are about 8-9 cases in different courts of Chittagong in which about 17 plots have been impacted. All the cases in the local courts are relating to land ownership instituted long before. Through the Writ petitions DC\r\nChittagong have been restrained to distribute compensation to stakeholders. The process for obtaining Khas Land from the Government needs to be launched urgently. In this regard CDA to decide on interchange No.3. CDA is to reply to the Notice for Demanding Justice by a lawyer on behalf of a group of interested persons. The necessity of a logical Framework to deal with un-authorized users of Khas lands needs to be considered by CDA. It is necessary that CDA be a party in Writ Petition 9136 of 2014 as compensation cannot be paid due to order from the High Court through the said Writ Petition. Formation of Grievance Redress Committee (GRC) and disposal of pending petitions is required. It was committed to JICA review mission to dispose the cases within one month from the date of the last review Mission meeting held at CDA Conference Room.\r\n', 2, '2', '', '', '2017-12-20', 1, 1, '', ''),
(2, 1, '02', 'Resettlement of PAPs Issues', 'Delays in the preparation of resettlement sites. This affects the relocation of project affected people (PAPs). - Relocation of Affected Persons in the designated resettlement areas is uncertain. - There are two Resettlement sites. For RS-2 only 90% earth filling is completed. The\r\ndevelopment work of RS-1 is not yet taken up. At this moment many of the displaced persons have taken refuge on the coastal side of the road under construction. In case any cyclone or tidal surge takes place, it may cause irreparable harm to these displaced persons.\r\n', 1, '1', '', '', '2018-10-11', 1, 2, '', ''),
(3, 1, '03', 'Other Project Related Issues', '1. Relocation/protection of utilities. Lengthy procedures are involved. Need to expedite the process. Processing of relocation of utilities in Feeder Road -3 is currently being kept on-hold. \r\n\r\n2. A formal agreement between CDA and RHD for the merger of the Toll Road with the\r\nCoastal Road is required to be finalised. - Draft Memorandum of Understanding (MoU) prepared by the Consultants. RHD made their amendments and sent to CDA for further action. \r\n\r\n3. Project Implementation Unit (PIU) is to be constituted and activated for easy coordination between stakeholder organisations. An Executive Engineer from BWDB is to be placed in PIU immediately.\r\n', 2, '1', '', '', '2018-11-20', 1, 1, '', ''),
(4, 1, '04', 'Labour Distribution Issues', 'Owners are on hold due to litigation by 2 landowners and subsequent high court injunction in this regard. - So far there are 6(six) live Writ Petitions before the Honourable High Court of\r\nBangladesh Division of Supreme Court of Bangladesh. Of those six cases three are concerning Feeder Road-2 at their preliminary stage. Further, there are about 8-9 cases in different courts of Chittagong in which about 17 plots have been impacted. All the cases in the local courts are relating to land ownership instituted long before. Through the Writ petitions DC\r\nChittagong have been restrained to distribute compensation to stakeholders. The process for obtaining Khas Land from the Government needs to be launched urgently. In this regard CDA to decide on interchange No.3. CDA is to reply to the Notice for Demanding Justice by a lawyer on behalf of a group of interested persons. The necessity of a logical Framework to deal with un-authorized users of Khas lands needs to be considered by CDA. It is necessary that CDA be a party in Writ Petition 9136 of 2014 as compensation cannot be paid due to order from the High Court through the said Writ Petition. Formation of Grievance Redress Committee (GRC) and disposal of pending petitions is required. It was committed to JICA review mission to dispose the cases within one month from the date of the last review Mission meeting held at CDA Conference Room.\r\n', 1, '2', '', '', '2017-03-20', 1, 1, '', ''),
(5, 1, '05', 'Covid Related Issues', '1. Relocation/protection of utilities. Lengthy procedures are involved. Need to expedite the process. Processing of relocation of utilities in Feeder Road -3 is currently being kept on-hold. \r\n\r\n2. A formal agreement between CDA and RHD for the merger of the Toll Road with the\r\nCoastal Road is required to be finalised. - Draft Memorandum of Understanding (MoU) prepared by the Consultants. RHD made their amendments and sent to CDA for further action. \r\n\r\n3. Project Implementation Unit (PIU) is to be constituted and activated for easy coordination between stakeholder organisations. An Executive Engineer from BWDB is to be placed in PIU immediately.\r\n', 1, '2', '', '', '2020-09-13', 1, 2, '', ''),
(6, 1, '06', 'CONSULTANTS CONTRACTUAL ISSUES', 'A. Approval is still waiting for the additional costs already notified as listed below:\r\n• Add Electrical Engineer to design team. \r\n• Extension of tenure of local Hydrologist. \r\n• Adjustment of tenure for local Structural Engineers. \r\n• Extension of tenure of foreign Quantity Engineer 12.\r\n• Additional costs (SMEC) in Design Phase.\r\n• Extension of tenure for local Geotechnical Engineer.\r\nB. Payment of interest on late payments has not been resolved.\r\nC. Payment of progress claims Nos. 46, 47, 48, 49, 50, 51 and 52 are outstanding. Long delays in certification and payment process resulting in cash-flow difficulties to the Consultants.\r\n', 1, '2', '', '', '2019-03-10', 1, 1, '', '');
INSERT INTO `t013nonconformitynotice` (`nos_id`, `pid`, `iss_no`, `iss_title`, `iss_detail`, `iss_status`, `iss_action`, `iss_remarks`, `attachment`, `lid`) VALUES
(1, 1, '1', 'Stock piling of Borrow Pit soil on the top of existing alignment, and in slope area Ch. 10+780- 11+320	', 'The stockpiled soil has been removed as per acceptance of the the proposal by the Engineer. and in presence of the Engineers representative. The removal of stockpiled materials started on 20/02/2016 to 25/02/2016. This is also related with the CAR-001 issued on 26/10/205.	', 2, 'Action Taken	', '', 'f9e5c-1.pdf', 1),
(3, 1, 'werfwsd', 'dsfdsdfds', 'sdf', 1, 'fd', 'sdfd', 'f48fb-3.jpg', 3),
(4, 1, '2', 'Fill materials dumped on the existing slope without benching and fill the pockets without compaction at Ch. 6+800 to 8+250 (R/S)	', 'Dumped earth has been removed from existing slope using pay loader & dozer and spread it on prepared bed. No pushing work done. All loose earth has been removed and the previous ground position identified in the presence of of Engineers representative. Dated 16.11.2016 and 17.11.2016 	', 1, 'Action Taken	', '', '82dd1-1.jpg', 1),
(5, 1, '3', 'Embankment fill material from Borrow Pits have been stock piled on the shoulder and existing slope at Ch. 9+500 to 9+540	', 'The Stock piled soil has been removed and used in the work as accepted by Engineer using excavator and dump truck. No pushing work done. the tree roots were uprooted and all holes was identified. after that slope surface has been cut out upto bottom of the roots to attain a compacted existing surface level. 	', 2, 'Action Taken	', '', 'b780b-1.jpg', 1),
(6, 1, '4', 'Embankment fill work at Ch. 9+500 to 9+550 has been started before preparing the initial layer, not removed soft soil.	', 'The work was stopped as soon as we received the NCR. The earth material placed at Ch. 109500 to 109550 (L/S) has been removed by dump truck and cleared the site at its previous condition. The soft soil find at the bed was also removed, then the bed was prepared in presence of the Engineers representative to form initial platform with layer by layer compaction. The filling work up to RL 5 has been properly in witness of the Engineers representative.  	', 2, 'Action Taken	', '', '7ce80-1.jpg', 1),
(7, 1, '5', 'Where some lots were not conducted density, and DCP tests Ch. 8+500 to 10+000, Lot No. EW/F/004 and EW/F/075	', 'During tool box meeting we have already advised our site supervisors and lab technicians to carry out the construction works and test the completed works as per technical specification requirement as well as checklist to ensure the quality of work.\r\nWe will continue counselling to site supervisor and lab technicians for preventing mistakes in future. We have conducted DCP 2nos and FDD 2nos tests as instructed by the Engineers representative which are attached.', 1, 'Action Taken	', '', '01ffa-1.jpg', 1),
(8, 1, '6', 'During dredging sand clay sedimentation and water ponding at the existing toe of the embankment Ch. 10+000 to 10+160	', 'Clay dyke has been provided near the proposed toe, so that dredged water now cannot enter near the toe area. Clay and unsuitable materials has been removed using dozer, excavator and dump truck. Some part of the unsuitable material was pushed out of the toe and bumpy area were excavated and removed using dump truck. After sun drying the bed, it has been filled layer by layer with suitable materials with proper compaction. The work has been witness by the Engineers representative (Sketch map attached) 	', 2, 'Action Taken	', '', '9e6ba-1.jpg', 1);
