INSERT INTO `tbl_rfi_lab` (`rfi_id`, `lid`, `contractor_no`, `section`, `site`, `rfi_number`, `rfi_prev_ref`, `rfi_Date`, `rfi_sub_date_time`, `rfi_activity_detail`, `rfi_activity_location`, `rfi_activity_location_from`, `rfi_activity_location_to`, `rfi_contractor_rep_name`, `RFI_Received_by`, `RFI_Received_date_time`, `rfi_time`, `RFI_Scanned_document`, `Survey_Surveyor_name`, `Survey_Date_time`, `survey_time`, `Survey_report`, `Survey_comments`, `Survey_document`, `Inspection_inspector_name`, `Inspection_Date_time`, `Inspect_time`, `Inspection_report`, `Inspection_comments`, `Inspection_document`, `Quality_MT_Engineer_name`, `Quality_testing_Date_time`, `Quality_time`, `Quality_test_perfomed`, `Quality_test_sample_numbers`, `Quality_test_report`, `Quality_test_result`, `Quality_test_comments`, `Quality_test_report_document`, `Approval_authority`, `Approval_authority_name`, `Approval_status`, `Approval_comments`, `Approval_documents`) VALUES
(1, 1, '0441552687', 'Section-345', 'BRDB', '2355', '0321', '2015-07-08', '2015-11-07', ' The RFI is used to solicit information in a formal and structured manner to keep everyone informed. It serves a number of industries, primarily construction, as a means to identify the requirements of the customer and at the same time getting answers to specific questions from the supplier.\r\n\r\nUsing an RFI helps customers learn about the market for the supply or service they need. It gathers that information in such a way that it’s easy to communicate and understand, which helps in the decision-making.\r\n\r\nThat said, the information gathered by the RFI is simple. Mostly, it asks about the size of the company, a bit on its history and what it specializes in. There could be requests for customer case studies, references, profiles of its executive suite and so on.\r\n\r\nIt is also helpful as part of the larger documentation for solicitation, which includes the RFP and RFQ. They all work together to help select the right product, good or service for the job. However, an RFI is not the process by which a supplier is selected, it merely responds to questions about what the supplier is offering.\r\n\r\nWhile market research is better fit for an RFP, the RFI can filter the long list of suppliers down to a handful that are appropriate for your needs. The work that goes into writing an RFI is well worth the return.     ', 'Bangaluru', 'Chennai', 'Bangaluru', 'Ashraf', 'Shuvam Bhardwaj', '2016-02-21', '03:05:00', '', 'Ashraf', '2022-03-24', '16:20:00', '    Employees are also a good audience to survey, as you can learn about their needs and determine how engaged they are at work. Insights from employee surveys can give you insight into whether you need to raise morale or make some significant changes within the organization. Regardless of who your audience is, it’s important that you present survey results in clear, easy-to-understand visuals. This enables you and your team to quickly and accurately draw conclusions that will inform the decisions your organization makes.', 'Accepted    ', '', 'ashraf', '2015-07-08', '15:26:00', '   Employees are also a good audience to survey, as you can learn about their needs and determine how engaged they are at work. Insights from employee surveys can give you insight into whether you need to raise morale or make some significant changes within the organization.\r\n\r\nRegardless of who your audience is, it’s important that you present survey results in clear, easy-to-understand visuals. This enables you and your team to quickly and accurately draw conclusions that will inform the decisions your organization makes.', '   accepted', '', 'Yousuf Alam', '1970-01-01', NULL, ' Employees are also a good audience to survey, as you can learn about their needs and determine how engaged they are at work. Insights from employee surveys can give you insight into whether you need to raise morale or make some significant changes within the organization.\r\n\r\nRegardless of who your audience is, it’s important that you present survey results in clear, easy-to-understand visuals. This enables you and your team to quickly and accurately draw conclusions that will inform the decisions your organization makes. ', 34, '  Accepted', ' Employees are also a good audience to survey, as you can learn about their needs and determine how engaged they are at work. Insights from employee surveys can give you insight into whether you need to raise morale or make some significant changes within the organization.\r\n\r\nRegardless of who your audience is, it’s important that you present survey results in clear, easy-to-understand visuals. This enables you and your team to quickly and accurately draw conclusions that will inform the decisions your organization makes. ', ' NA ', '623d9-.pdf', '2', '1', 3, ' Partially Approved     ', ''),
(8, 1, '0441552687', 'd', '', 'd', '', '2022-03-13', '0000-00-00', ' ', '', '', '', '', '', '0000-00-00', '00:00:00', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
